import React, { useState } from 'react';

function SignupForm() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmpassword, setConfirmPassword] = useState('');
  const [name, setName] = useState('');

  const handleEmailChange = (e) => {
    setEmail(e.target.value);
  };

  const handlePasswordChange = (e) => {
    setPassword(e.target.value);
  };
  const handleConfirmPassword = (e) => {
    setConfirmPassword(e.target.value);
  };

  const handleNameChange = (e) => {
    setName(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // 회원가입 요청 처리
    // 이 부분에서 실제로 서버와 통신하여 회원가입 처리를 수행합니다.
    // 예시로는 간단히 콘솔에 회원가입 정보를 출력하는 예시를 보여줍니다.
    if (email != confirmpassword ) {
        setError('비밀번호가 다릅니다.');
        return;
      }
    console.log('Email:', email);
    console.log('Password:', password);
    console.log('Name:', name);

    // 회원가입 후에 필요한 처리를 수행합니다.
    // 예를 들어, 회원가입 성공 시에 다른 페이지로 이동하거나 상태를 업데이트하는 등의 작업을 수행할 수 있습니다.
  };

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label>Email:</label>
        <input type="email" value={email} onChange={handleEmailChange} />
      </div>
      <div>
        <label>비밀번호 :</label>
        <input type="password" value={password} onChange={handlePasswordChange} />
      </div>
      <div>
        <label>비밀번호 확인 :</label>
        <input type="password" placeholder='********' value={confirmpassword} onChange={handleConfirmPassword} />
      </div>
      <div>
        <label>수영장 이름:</label>
        <input type="text" value={name} onChange={handleNameChange} />
      </div>
      <button type="submit">Sign up</button>
    </form>
  );
}

export default SignupForm;
